function TE = Burgers2d_analyticTE(x,y,RE,Lref)
%% test
RE = 32;
Lref = 8;

%create initial mesh
imax = 41;
jmax = imax;

x = repmat(linspace(-Lref/2,Lref/2,imax)',1,jmax);
y = repmat(linspace(-Lref/2,Lref/2,jmax),imax,1);

%% 
dxi = 1;
deta = 1;

dxdxidisc = fd2d_dudx(x,dxi);
dxdetadisc= fd2d_dudy(x,deta);
dydxidisc = fd2d_dudx(y,dxi);
dydetadisc= fd2d_dudy(y,deta);

d2xdxi2disc = fd2d_d2udx2(x,dxi);
d2xdeta2disc = fd2d_d2udy2(x,deta);
d2xdxidetadisc= fd2d_d2udxy(x,dxi,deta);

d2ydxi2disc = fd2d_d2udx2(y,dxi);
d2ydeta2disc = fd2d_d2udy2(y,deta);
d2ydxidetadisc= fd2d_d2udxy(y,dxi,deta);

Jdisc       = dxdxidisc .* dydetadisc - dxdetadisc .* dydxidisc;
J2disc      = Jdisc .^ 2;
dJdxidisc = (d2xdxi2disc .* dydetadisc + dxdxidisc .* d2ydxidetadisc) - (d2xdxidetadisc .* dydxidisc + dxdetadisc .* d2ydxi2disc );
dJdetadisc = (d2xdxidetadisc .* dydetadisc + dxdxidisc .* d2ydeta2disc) - (d2xdeta2disc .* dydxidisc + dxdetadisc .* d2ydxidetadisc);

x_xiJdisc   = dxdxidisc ./ Jdisc;
x_etaJdisc  = dxdetadisc ./ Jdisc;
y_xiJdisc   = dydxidisc ./ Jdisc;
y_etaJdisc  = dydetadisc ./ Jdisc;

% f = g/h
% f' = (g'h - gh') / h^2

xxiJdxidisc   = (d2xdxi2disc .* Jdisc - dxdxidisc .* dJdxidisc) ./ J2disc;
xxiJdetadisc   = (d2xdxidetadisc .* Jdisc - dxdxidisc .* dJdetadisc) ./ J2disc;

xetaJdxidisc  = (d2xdxidetadisc .* Jdisc - dxdetadisc .* dJdxidisc) ./ J2disc;
xetaJdetadisc  = (d2xdeta2disc .* Jdisc - dxdetadisc .* dJdetadisc) ./ J2disc;

yxiJdxidisc   = (d2ydxi2disc .* Jdisc - dydxidisc .* dJdxidisc) ./ J2disc;
yxiJdetadisc   = (d2ydxidetadisc .* Jdisc - dydxidisc .* dJdetadisc) ./ J2disc;

yetaJdxidisc  = (d2ydxidetadisc .* Jdisc - dydetadisc .* dJdxidisc) ./ J2disc;
yetaJdetadisc  = (d2ydeta2disc .* Jdisc - dydetadisc .* dJdetadisc) ./ J2disc;


%solution derivatives ********************************
  u = uxn(x,y,RE,Lref,0);

  dudxi = fd2d_dudx(u,dxi);
  d2udxi2 = fd2d_d2udx2(u,dxi);
  dudeta = fd2d_dudy(u,deta);
  d2udeta2 = fd2d_d2udx2(u,deta);
  d2udxideta = fd2d_d2udxy(u,dxi,deta);


  nu = 2*Lref/RE;
  
TE = ...
    u .* ((y_etaJdisc - x_etaJdisc) .* dudxi + (x_xiJdisc - y_xiJdisc) .* dudeta) - ...
    nu .* ( ...
    (y_etaJdisc .^ 2 + x_etaJdisc .^ 2) .* d2udxi2 ...
    - 2 * ( (dydxidisc .* dydetadisc) ./ J2disc + (dxdxidisc .* dxdetadisc) ./ J2disc ) .* d2udxideta ...
    + (y_xiJdisc .^2 + x_xiJdisc .^2) .* d2udeta2 ...
    + (y_etaJdisc .* yetaJdxidisc + x_etaJdisc .* xetaJdxidisc - ...
       y_xiJdisc .* yetaJdetadisc - x_xiJdisc .* xetaJdetadisc) .* dudxi ...
    + (-y_etaJdisc .* yxiJdxidisc - x_etaJdisc .* xxiJdxidisc + ...
       y_xiJdisc .* yxiJdetadisc + x_xiJdisc .* xxiJdetadisc) .* dudeta );   

  TE([1,imax],:)=0;
  TE(:,[1,jmax])=0;   

return

